import React, { useState } from "react";
import styles from "./index.module.scss";
import TextField from "@material-ui/core/TextField";
import MenuItem from "@material-ui/core/MenuItem";
import Select from "@material-ui/core/Select";
import FormControl from "@material-ui/core/FormControl";
import FormHelperText from "@material-ui/core/FormHelperText";

function StartPollForm() {
  const [roomName, setRoomName] = useState("");
  const [series, setSeries] = useState([]);
  const [allCanSee, setAllCanSee] = useState(false);

  const handleSeriesSelect = (event) => {
    setSeries(event.target.value);
  };

  const SERIES = [
    ["0", "1", "2", "3", "5", "8", "13", "21"],
    ["0", "1/2", "1", "2", "3", "5", "8", "13"],
  ];
  return (
    <div className={styles.pollform}>
      Start New Game
      <div className={styles.form}>
        <TextField
          id="outlined-basic"
          label="Enter Game's Name"
          variant="outlined"
          onChange={(e) => setRoomName(e.target.value)}
        />
        <FormControl variant="outlined">
          <Select
            labelId="demo-simple-select-outlined-label"
            id="demo-simple-select-outlined"
            label="Series"
            onChange={handleSeriesSelect}
          >
            <MenuItem value={10}>
              {SERIES[0].map((entry) => `${entry}, `)}
            </MenuItem>
            <MenuItem value={20}>
              {SERIES[1].map((entry) => `${entry}, `)}
            </MenuItem>
          </Select>
          <FormHelperText>Select Series</FormHelperText>
        </FormControl>
        <FormControl variant="outlined">
          <Select
            labelId="demo-simple-select-outlined-label"
            id="demo-simple-select-outlined"
            label="Who can view results?"
          >
            <MenuItem value={20}>Twenty</MenuItem>
            <MenuItem value={30}>Thirty</MenuItem>
          </Select>
          <FormHelperText>Who can view results?</FormHelperText>
        </FormControl>
      </div>
    </div>
  );
}

export default StartPollForm;
